import './Collaborator.css';

const Collaborator = (props) => {
    /* States */
    const [nombre, puesto, foto, equipo] = props;

    return <div className='collaborator'>
        <div className='collaboratorHeader'>
            <img src='https://github.com/October29.png' alt='Luis Puerta'/>
            <h3>Luis Puerta</h3>
            <p>Diseñador gráfico</p>
        </div>
    </div>
};

export default Collaborator;
